МЕНЯ ВСЕГДА МОЖНО ПОДКУПИТЬ!!!!!

ЗАПРЕЩЕНО:
Ссылки в любом виде, на любые сторонние ресурсы - бан 14 дней;
Мат, завуалированный мат, мат в статусе или имени отображающемся для всеобщего обозрения - бан 14 дней;
Распространение заведомо ложной информации об игре, других игроках, модерации, администрации проекта - бан 14 дней;
Распространение неподтвержденной информации об обновлениях - бан 14 дней;
Оскорбление игроков, администрации, модерации проекта - бан 30 дней;
Обсуждение бота (любых сторонних программ) - бан 3650 дней;
Флуд (размещение однотипных сообщений), а также вайп, как разновидность флуда - бан 7 дней;
Троллинг, как размещение провокационных сообщений - бан 30 дней; 

Игрокам, которые были заблокированы за использование сторонних программ, стала доступна система разбана. 
Первый разбан бесплатный, но списывает все золото. Второй - 50 бриллиантов. Третий - 500 бриллиантов. Четвертая и последующие блокировки не снимаются.
